import React from 'react';

const topPart = {
    height: "40vh",
}

export default function Frontpage() {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-2"></div>
                <div className="col-8">
                    <h1 className="display-3 text-center">Hey, I'm <strong className="text-danger">Nikolaj Jensen</strong>.</h1>
                    <p className="h2 text-center">Specialized <strong className="text-danger">biologist</strong> and experienced <strong className="text-danger">programmer</strong></p>
                    <p className="h2 text-center">I design and code awesome stuff, and I love what I do!</p>
                    <p className="p-5">
                        <button className="btn btn-outline-dark btn-lg" type="button" href="#carouselExampleControls">See my work</button>
                    </p>
                </div>
                <div className="col-2"></div>                
            </div>
        </div>
    )
}
